import React from "react";

import "../../index.css";
import LandingPageNavbar from "./sections/LandingPageNavbar";

import Me from "../../assets/me.jpeg";
import { Col, Row, Card, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div>
      <LandingPageNavbar />
      <header className="bg-info text-white text-center">
        <div className="container d-flex align-items-center justify-content-around flex-row landingDiv">
          <img
            style={{
              borderTopLeftRadius: "50px",
              borderBottomLeftRadius: "50px"
            }}
            className="mb-5 mt-5 shadow img-fluid me"
            src={Me}
            alt="hello"
          />
          <div>
            <h2 className="text-uppercase mb-0"><b>hi, i am </b></h2>
            <div className="divider-custom divider-light">
              <div className="divider-custom-line"></div>
              <div className="divider-custom-icon">
                <i className="fas fa-star"></i>
              </div>
              <div className="divider-custom-line"></div>
            </div>
            <p className="masthead-subheading font-weight-light mb-0">
              Graphic Artist - Web Designer - Illustrator
            </p>
          </div>
        </div>
      </header>
    </div>
  );
};

export default LandingPage;
